  const[value,setValue]= useState(0);
  function handleClick(name ){
    setValue(value+1);
  }
  return (
    <div className="App">
     <Display value = {value}/>,
     <ButtonsPanel buttonName = '+' buttonAction = {handleClick} />
    </div>
  );

}
